<!DOCTYPE html>
<html>
<head>
  <base href="/BinaryLurkerex/">

  <meta charset="UTF-8">
  <meta content="IE=Edge" http-equiv="X-UA-Compatible">
  <meta name="description" content="BinaryLurkerex Profile Page">

  <meta name="apple-mobile-web-app-capable" content="yes">
  <meta name="apple-mobile-web-app-status-bar-style" content="black">
  <meta name="apple-mobile-web-app-title" content="profile">
  <link rel="apple-touch-icon" href="icons/apple-touch-icon.png">

  <link rel="icon" type="image/png" href="icons/icon-512-maskable"/>

  <title>BinaryLurkerex</title>
  <link rel="manifest" href="manifest.json">

  <script>
    const serviceWorkerVersion = "2477906122";
  </script>
  <script src="flutter.js" defer></script>
</head>
<body>
  <script>
    window.addEventListener('load', function(ev) {
      _flutter.loader.loadEntrypoint({
        serviceWorker: {
          serviceWorkerVersion: serviceWorkerVersion,
        },
        onEntrypointLoaded: function(engineInitializer) {
          engineInitializer.initializeEngine().then(function(appRunner) {
            appRunner.runApp();
          });
        }
      });
    });
  </script>
</body>
</html>
